package source_test

import (
	"bytes"
	"github.com/mightymatth/earthquake-tools/aggregator/source"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestUsgs_Transform(t *testing.T) {
	s := source.NewUsgs()

	events, err := s.Transform(bytes.NewReader([]byte(usgsResponse)))
	if err != nil {
		t.Errorf("cannot transform events: %v", err)
		return
	}

	assert.Equal(t, 10, len(events))
	eventsValid(t, events)
}

